import './App.css';
import {Routes, Route} from 'react-router-dom'
import Navbar from "./components/navbar";

function App() {
  return (
    <div>
      <div className='min-h-screen p-6 bg-white text-gray-600 text-lg'>
        <Navbar/>
          <Routes>
            <Route
              path = '/'
              element = {
                <Home/>
              }
            />
            <Route
              path = '/Planning'
              element = {
                <Planning/>
              }
            />
            <Route/>
          </Routes>
      </div>
    </div>
  );
}

export default App;
